import React, {Component} from 'react';
import Col from "react-bootstrap/Col";
import poster from "../images/poster.jpg";
import research from "../images/research.jpg";
import detour from "../images/detour.jpg";

export default class Work extends Component {
    render(){
        var imgStyle = {height:"175px"}

        return (
            <div className="work-container">
                <div className={"row"}>
                    <Col sm={4}>
                        <h5>Detour</h5>
                        <a className= "icon-link" href="https://pathh-detour.herokuapp.com">
                            <img class="img-thumbnail" src={detour} style = {imgStyle}/>
                        </a>
                        <p>A route planning web app for finding landmarks along a path (Project for CSE 110: Software Engineer) </p>
                    </Col>
                    <Col sm={4} >
                        <h5>Research Paper</h5>
                        <a className= "icon-link" href="https://doi.org/10.1088/1367-2630/aae3fb">
                            <img className="img-thumbnail" src={research} style={imgStyle}/>
                        </a>
                        <p>Phase Cascade Lattice Rectifier Array: An Exactly Solvable Nonlinear Network Circuit</p>
                    </Col>
                    <Col sm={4} >
                        <h5>Research Poster</h5>
                        <a className= "icon-link" href="bit.ly/JC_BU_RISE">
                            <img className="img-thumbnail" src={poster} style={imgStyle}/>
                        </a>
                        <p>Boston University Research in Science and Engineering Program </p>

                    </Col>
                </div>
            </div>
        );
    }
}
